INSERT INTO `v1_fe71908bcb5a8b0c1c0d9095e57dfab6eb23d202e3f671e18d0ac21685b962a2` VALUES (91002, 40, 2834, 10118, "青空の下で謁見", 2, 5118061, 0, 1, "ペコリーヌとの出会い", "フリーマーケット会場", "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", 7, 8, 0);
INSERT INTO `v1_fe71908bcb5a8b0c1c0d9095e57dfab6eb23d202e3f671e18d0ac21685b962a2` VALUES (91002, 40, 2835, 10118, "未来の騎空団\nマスコット？", 2, 5118062, 0, 1, "マホとの出会い", "フリーマーケット会場", "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", 7, 8, 0);
INSERT INTO `v1_fe71908bcb5a8b0c1c0d9095e57dfab6eb23d202e3f671e18d0ac21685b962a2` VALUES (91002, 40, 2837, 10118, "お嬢さまからの\n緊急依頼", 2, 5118063, 0, 1, "アキノとの出会い", "ランドソル市街地", "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", 7, 8, 0);
INSERT INTO `v1_fe71908bcb5a8b0c1c0d9095e57dfab6eb23d202e3f671e18d0ac21685b962a2` VALUES (91002, 40, 4108402, 10118, "黄金色の悩みごと", 2, 5118064, 0, 1, "ジュンとの出会い", "フリーマーケット会場", "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", 18, 8, 0);
INSERT INTO `v1_fe71908bcb5a8b0c1c0d9095e57dfab6eb23d202e3f671e18d0ac21685b962a2` VALUES (91002, 40, 4107402, 10118, "白熱！　格闘大会！", 2, 5118065, 0, 1, "カオリとの出会い", "フリーマーケット会場", "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", 18, 8, 0);
INSERT INTO `v1_fe71908bcb5a8b0c1c0d9095e57dfab6eb23d202e3f671e18d0ac21685b962a2` VALUES (91002, 40, 9000227, 10118, "祭り太鼓はオーエドの華", 2, 5118066, 0, 1, "ニノンとの出会い", "オーエド町", "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", 16, 8, 1);
INSERT INTO `v1_fe71908bcb5a8b0c1c0d9095e57dfab6eb23d202e3f671e18d0ac21685b962a2` VALUES (91002, 40, 2101181, 10118, "人気者は遅れて\nやってくる", 3, 5118067, 0, 1, "スズナとの出会い", "フリーマーケット会場", "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", 19, 8, 0);
INSERT INTO `v1_fe71908bcb5a8b0c1c0d9095e57dfab6eb23d202e3f671e18d0ac21685b962a2` VALUES (91002, 40, 4109402, 10118, "巫女・ミーツ・魔法少女", 3, 5118068, 0, 1, "ナナカとの出会い", "ランドソル市街地", "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", 18, 8, 0);
INSERT INTO `v1_fe71908bcb5a8b0c1c0d9095e57dfab6eb23d202e3f671e18d0ac21685b962a2` VALUES (91002, 40, 4305402, 10118, "ネズ耳は二度なくなる", 3, 5118069, 0, 1, "キャル＆コッコロとの出会い", "フリーマーケット会場", "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", 18, 8, 0);
INSERT INTO `v1_fe71908bcb5a8b0c1c0d9095e57dfab6eb23d202e3f671e18d0ac21685b962a2` VALUES (91002, 40, 4101402, 10118, "この出会いにカンパイ！", 3, 5118070, 0, 1, "ユカリとの出会い", "ランドソル市街地", "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", 18, 8, 0);
INSERT INTO `v1_fe71908bcb5a8b0c1c0d9095e57dfab6eb23d202e3f671e18d0ac21685b962a2` VALUES (91002, 40, 4106402, 10118, "陰陽アンサンブル", 3, 5118071, 0, 1, "アオイとの出会い", "ランドソル市街地", "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", 18, 8, 0);
INSERT INTO `v1_fe71908bcb5a8b0c1c0d9095e57dfab6eb23d202e3f671e18d0ac21685b962a2` VALUES (91002, 40, 2836, 10118, "運試し十番勝負！", 3, 5118072, 0, 1, "シノブとの出会い", "フリーマーケット会場", "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", 7, 8, 1);
INSERT INTO `v1_fe71908bcb5a8b0c1c0d9095e57dfab6eb23d202e3f671e18d0ac21685b962a2` VALUES (0, 0, 0, 10118, "彼女たちの新たな日常", 1, 5118600, 10145115, 0, "オープニング", 0, 0, 0, 0, 0);
